import certificationImage from '../images/certification.png'; // Import your certification image
const certifications = [
    {
      title: "PCEP – Certified Entry-Level Python Programmer",
      imageUrl: {certificationImage}, // replace with your image path
      link: "https://verify.openedg.org/?id=your_python_certification_id"
    },
  ];

  export default certifications; // This is important!
